import React from 'react';
import './App.scss';

import Sidebar from './components/Sidebar/Sidebar';
import Board from './components/Board/Board';
import DragDropComponent from './components/DragDropComponent/DragDropComponent';
import Panel from './components/Panel/Panel';
import Task from './components/Task/Task';

const App: React.FC = () => {
  let tasks: Array<JSX.Element>;
  tasks.push(<Task 
      taskCategory="IT"
      taskName="Implement redux to project"
      taskDate="03-09-2019"
      taskStatus="Active"
  />);
  return (
    <div className="app">
      {/*<Sidebar /> 
      <Board 
        boardName="Board 1"
        boardDueDate="01-10-2019"
      />
      <DragDropComponent />*/}
      <Panel 
        panelTitle="IN PROGRESS"
        panelQuantity={10}
      />
    </div>
  );
}

export default App;
